    false,nt"url": null,nt"notes": "This dataset provides the known distribution
    of 12 species of invasive plants in southern Orange County: Acacia (Acacia sp.)
    Brazilian pepper tree (Schinus terebinthifolius) Cape ivy (Delairea odorata) Chilean
    pepper tree (Schinus molle) Eucalyptus (Eucalyptus sp.) Japanese honesuckle (Lonicera
    japonica) Myoporum (Myoporum lateum) Non-native ash (Fraxinus sp.) Periwinkle (Vinca
    major) Russian olive Tamarisk (Tamarix sp.) Tree-of-heaven (Ailanthus altissima)
    There are four other datasets on the four most problematic invasive plants in this
    area: Arundo (Arundo donax) Canary Island date palm (Phoenix canariensis) Mexican
    fan palm (Washingtonia robusta) Pampas grass (Cortaderia selloana) The surveys for
    these plants were conducted from May to June, 2007 and were funded by the California
    Department of Fish and Game.",nt"license_title": null,nt"extras": [{ntt"key":
